import React, { Component } from "react";;
import {
  Container,
  Button,
  Modal,
  ModalBody,
  ModalHeader,
  ModalFooter,
  Col,
  Row
} from "mdbreact";

class Stock extends Component {
  render() {
    return class ModalPage extends React.Component {
      constructor(props) {
        super(props);
        this.state = {
          modal16: false
        };
      }

      toggle(nr) {
        let modalNumber = "modal" + nr;
        this.setState({
          [modalNumber]: !this.state[modalNumber]
        });
      }

      render() {
        return (
          <Container>
            <Button onClick={() => this.toggle(16)}>Modal</Button>
            <Modal isOpen={this.state.modal16} toggle={() => this.toggle(16)}>
              <ModalHeader toggle={() => this.toggle(16)}>
                Modal title
              </ModalHeader>
              <ModalBody>
                <Container fluid className="text-white">
                  <Row>
                    <Col md="4" className="bg-info">
                      .col-md-4
                    </Col>
                    <Col md="4" className="ml-auto bg-info">
                      .col-md-4 .ml-auto
                    </Col>
                  </Row>
                  <br />
                  <Row>
                    <Col md="3" className="ml-auto bg-info">
                      .col-md-3 .ml-auto
                    </Col>
                    <Col md="2" className="ml-auto bg-info">
                      .col-md-2 .ml-auto
                    </Col>
                  </Row>
                  <Row>
                    <Col md="6" className="ml-5 bg-info">
                      .col-md-6 .ml-5
                    </Col>
                  </Row>
                  <br />
                  <Row>
                    <Col sm="9" className="bg-info">
                      Level 1: .col-sm-9
                      <Row>
                        <Col sm="6" className="bg-info">
                          Level 2: .col-8 .col-sm-6
                        </Col>
                        <Col sm="6" className="bg-info">
                          Level 2: .col-4 .col-sm-6
                        </Col>
                      </Row>
                    </Col>
                  </Row>
                </Container>
              </ModalBody>
              <ModalFooter>
                <Button color="secondary" onClick={() => this.toggle(16)}>
                  Close
                </Button>{" "}
                <Button color="primary">Save changes</Button>
              </ModalFooter>
            </Modal>
          </Container>
        );
      }
    };
  }
}

export default Stock;
